import { AuthProvider } from '../contexts/auth'

interface Return extends JSX.Element {
  displayName?: string
}
const withAuth = (Component: React.ElementType): React.ElementType => {
  return (props: Record<string, unknown>) => (
    <AuthProvider>
      <Component {...props} />
    </AuthProvider>
  )
}

export { withAuth }
